  "user_id" character varying,
  "amount" numeric NOT NULL,
  "currency" character varying DEFAULT 'USD'::character varying,
  "status" character varying NOT NULL,
  "gateway" character varying NOT NULL,
  "gateway_transaction_id" character varying,
  "description" text,
  "metadata" jsonb,
  "created_at" timestamp without time zone DEFAULT now()
);

-- No data in table: transactions


-- Table: users
DROP TABLE IF EXISTS "users" CASCADE;
CREATE TABLE "users" (
  "id" character varying NOT NULL DEFAULT gen_random_uuid(),
  "email" character varying,
  "username" character varying(100),
  "password" character varying(255),
  "first_name" character varying,
  "last_name" character varying,
  "profile_image_url" character varying,
  "role" character varying NOT NULL DEFAULT 'user'::character varying,
  "permissions" jsonb,
  "is_active" boolean DEFAULT true,
  "last_login" timestamp without time zone,
  "login_attempts" integer DEFAULT 0,
  "two_factor_enabled" boolean DEFAULT false,
  "two_factor_secret" character varying,
  "password_reset_token" character varying,
  "password_reset_expires" timestamp without time zone,
  "created_at" timestamp without time zone DEFAULT now(),
  "updated_at" timestamp without time zone DEFAULT now()
);

